(42,	'woocommerce-WCSubscriptions-June-2023-updated-needed',	'marketing',	'en_US',	'Action required: Security update of WooCommerce Subscriptions',	'<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(43,	'woocommerce-WCReturnsWarranty-June-2023-updated-needed',	'update',	'en_US',	'Action required: Security update of WooCommerce Returns and Warranty Requests extension',	'<strong>Your store requires a security update for the Returns and Warranty Requests extension</strong>.  Please update to the latest version of the WooCommerce Returns and Warranty Requests extension immediately to address a potential vulnerability discovered on May 31.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(44,	'woocommerce-WCOPC-June-2023-updated-needed',	'update',	'en_US',	'Action required: Security update of WooCommerce One Page Checkout',	'<strong>Your shop requires a security update to address a vulnerability in the WooCommerce One Page Checkout extension</strong>. The fix for this vulnerability was released for this extension on June 13th. Please update immediately.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(45,	'woocommerce-WCGC-July-2023-update-needed',	'update',	'en_US',	'Action required: Security update of WooCommerce GoCardless Extension',	'<strong>Your shop requires a security update to address a vulnerability in the WooCommerce GoCardless extension</strong>. The fix for this vulnerability was released on July 4th. Please update immediately.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(46,	'woocommerce-shipping-fedex-api-outage-2023-07-16',	'warning',	'en_US',	'Scheduled FedEx API outage — July 2023',	'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(47,	'wcship-2023-07-hazmat-update-needed',	'update',	'en_US',	'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension',	'<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(48,	'woocommerce-WCStripe-Aug-2023-update-needed',	'update',	'en_US',	'Action required: Security update for WooCommerce Stripe plugin',	'<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(49,	'woocommerce-WCStripe-Aug-2023-security-updated',	'update',	'en_US',	'Security update of WooCommerce Stripe plugin',	'<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(50,	'woocommerce-WooPayments-Aug-2023-security-updated',	'update',	'en_US',	'Security update of WooPayments (WooCommerce Payments) plugin',	'<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(51,	'avalara_q3-2023_noAvaTax',	'marketing',	'en_US',	'Automatically calculate VAT in real time',	'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(52,	'woocommerce-usermeta-Sept2023-productvendors',	'update',	'en_US',	'Your store requires a security update',	'<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(53,	'woocommerce-STRIPE-Oct-2023-update-needed',	'update',	'en_US',	'Action required: Security update for WooCommerce Stripe Gateway',	'<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(54,	'amazon-mcf-reviews-2023-12-07',	'marketing',	'en_US',	'Enjoying Amazon MCF for WooCommerce?',	'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(55,	'remove_estimated_deposits_2024',	'marketing',	'en_US',	'Estimated deposits are going away',	'To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.',	'{}',	'pending',	'woocommerce.com',	'2024-09-02 09:17:50',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(56,	'wc-admin-choosing-a-theme',	'marketing',	'en_US',	'Stai scegliendo un tema?',	'Dai un\'occhiata ai temi compatibili con WooCommerce e scegline uno che richiami il tuo marchio e soddisfi le esigenze della tua attività.',	'{}',	'unactioned',	'woocommerce-admin',	'2024-09-03 17:13:06',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(57,	'wc-admin-customizing-product-catalog',	'info',	'en_US',	'Come personalizzare il tuo catalogo prodotti',	'Desideri che il tuo catalogo dei prodotti e le immagini abbiano un bell\'aspetto e siano in linea con il tuo marchio. Questa guida ti fornirà tutti i suggerimenti di cui hai bisogno per rendere i tuoi prodotti fantastici nel tuo negozio.',	'{}',	'unactioned',	'woocommerce-admin',	'2024-09-03 17:13:06',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(58,	'wc-admin-launch-checklist',	'info',	'en_US',	'Pronto a lanciare il tuo negozio?',	'Per essere sicuro di non provare mai un senso di irrequietezza \"cosa ho dimenticato\", abbiamo riunito in una checklist gli elementi essenziali prelancio.',	'{}',	'unactioned',	'woocommerce-admin',	'2024-09-03 17:13:06',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(59,	'wc-admin-mobile-app',	'info',	'en_US',	'Installa l\'app Woo',	'Installa l\'app per dispositivi mobili WooCommerce per gestire gli ordini, riceve le notifiche delle vendite e visualizzare le metriche chiave, ovunque tu sia.',	'{}',	'unactioned',	'woocommerce-admin',	'2024-09-04 17:17:26',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(60,	'bfcm2024-landing-page',	'marketing',	'en_US',	'The best way to prepare for holiday success',	'The upcoming holiday season is the busiest time of the year for many online stores. We want to help you make the most of it with an early gift: our first-ever Black Friday Cyber Monday Trends Report. It\'s full of stats, trends, and recommendations to knock your holiday socks off!',	'{}',	'pending',	'woocommerce.com',	'2024-09-04 17:17:27',	NULL,	0,	'plain',	'',	0,	0,	'info'),
(61,	'wc-admin-onboarding-payments-reminder',	'info',	'en_US',	'Inizia ad accettare i pagamenti sul tuo negozio!',	'Ricevi i pagamenti attraverso il provider giusto per te: scegli tra oltre 100 gateway di pagamento per WooCommerce.',	'{}',	'unactioned',	'woocommerce-admin',	'2024-09-07 16:49:37',	NULL,	0,	'plain',	'',	0,	0,	'info');
